Objectif : Apprendre à créer une action GitHub personnalisée (en JavaScript/Node.js). Créez un répertoire my-custom-action à la racine de votre dépôt. Dans my-custom-action, créez action.yml : name: 'Mon Action Perso'
description: 'Salue une personne et donne l heure.'
inputs: qui_saluer: description: 'Qui saluer ?' required: true default: 'Monde'
outputs: temps: description: 'L heure de la salutation.'
runs: using: 'node20' # Utiliser une version Node.js LTS main: 'index.js' Dans my-custom-action, initialisez un projet Node (npm init -y) et installez les dépendances (npm install @actions/core @actions/github). Puis créez index.js : // my-custom-action/index.js
const core = require('@actions/core');
// const github = require('@actions/github'); // Pas utilisé dans cet exemple simple async function run() { try { const quiASaluer = core.getInput('qui_saluer'); console.log(`Bonjour, ${quiASaluer} !`); const time = (new Date()).toTimeString(); core.setOutput("temps", time); } catch (error) { core.setFailed(error.message); }
} run(); Note : Pour que cette action soit utilisable dans le workflow, vous devrez commiter my-custom-action/index.js, my-custom-action/action.yml, my-custom-action/package.json, my-custom-action/package-lock.json et le dossier node_modules de l'action, OU mieux, utiliser un bundler comme @vercel/ncc pour packager votre action en un seul fichier JS (plus avancé, mais meilleure pratique). Pour cet exo, le plus simple est de tout commiter ou de faire un npm install dans l'action elle-même (voir ci-dessous). Modifiez votre fichier de workflow principal pour utiliser cette action : name: CI avec Action Personnalisée on: [push] jobs: build_avec_action_perso: runs-on: ubuntu-latest steps: - name: Checkout du code uses: actions/checkout@v4 # Option 1: Si node_modules n'est pas commité avec l'action - name: Installer les dépendances de l'action perso run: npm install --prefix my-custom-action # Exécute npm install dans le dossier de l'action - name: Exécuter mon action personnalisée id: salutation uses: ./my-custom-action # Chemin vers le dossier de l'action locale with: qui_saluer: 'les Participants à la Formation' - name: Afficher l'output de l'action run: echo "L'action a été exécutée à ${{ steps.salutation.outputs.temps }}" Poussez les modifications sur GitHub. Intérêt : Créer vos propres actions vous permet de réutiliser du code logique complexe dans plusieurs workflows. Application réelle : Automatiser une tâche spécifique à votre entreprise.

