} Crée la classe de test CalculatriceTest.java dans src/test/java/com/maventdd/app/ (à côté de AppTest.java). Utilise la syntaxe JUnit 4 (comme dans AppTest.java généré) : package com.maventdd.app; // Assure-toi que le package est correct import static org.junit.jupiter.api.Assertions.assertEquals; import org.junit.jupiter.api.Test; public class CalculatriceTest { @Test public void testAdditionner() { Calculatrice calc = new Calculatrice(); assertEquals(5, calc.additionner(2, 3)); }
} Modifie App.java pour instancier Calculatrice (juste pour s'assurer qu'elle est bien prise en compte par la compilation si besoin, bien que les tests devraient suffire) : package com.maventdd.app; public class App { public static void main( String[] args ) { System.out.println( "Hello World!" ); Calculatrice calc = new Calculatrice(); // Ajout pour que la classe soit "vue" }
}
